import React, { useState, useEffect } from 'react';
import { Line, Bar, Doughnut } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  BarElement,
  LineElement,
  ArcElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, BarElement, ArcElement, Title, Tooltip, Legend);

function App() {
  const [priceData, setPriceData] = useState([]);
  const [timeData, setTimeData] = useState([]);
  const [volumeData, setVolumeData] = useState([]);
  const [alerts, setAlerts] = useState([]);
  const [tradeHistory, setTradeHistory] = useState([]); // 거래 기록 상태
  const [trend, setTrend] = useState('상승세'); // 초기값은 상승세로 설정
  const [totalProfit, setTotalProfit] = useState(5000); // 총수익 초기값
  const [previousProfit, setPreviousProfit] = useState(5000); // 이전 수익값
  const [profitChange, setProfitChange] = useState(0); // 수익의 변동폭
  const [isProfitIncreasing, setIsProfitIncreasing] = useState(true); // 수익 증가 여부
  const [accuracy, setAccuracy] = useState(85); // 예측 정확도 초기값
  const [profitRate, setProfitRate] = useState(20); // 수익률 초기값

  useEffect(() => {
    const fetchDummyData = () => {
      // 더미 데이터 업데이트
      const dummyPrice = (Math.random() * (60000 - 50000) + 50000).toFixed(2);
      const dummyVolume = (Math.random() * 100).toFixed(2);
      const currentTime = new Date().toLocaleTimeString();

      // 실시간으로 수익률과 정확도 변경
      setProfitRate(Math.floor(Math.random() * 100)); // 0~100% 사이의 랜덤 수익률
      setAccuracy(Math.floor(Math.random() * 100)); // 0~100% 사이의 랜덤 정확도

      // 실시간으로 총수익 변경 (0~1000 사이 랜덤 수익 변화)
      const newProfit = totalProfit + Math.floor(Math.random() * 200 - 100); // 총수익이 +/- 100 변동
      setPreviousProfit(totalProfit); // 이전 총수익 저장
      setTotalProfit(newProfit); // 새로운 총수익 설정

      // 수익 변동폭 계산 및 상승/하락 여부 결정
      const change = newProfit - previousProfit;
      setProfitChange(change);
      setIsProfitIncreasing(change >= 0); // 수익이 증가하는지 여부 판단

      // 가격 데이터 및 시간 데이터 추가
      setPriceData((prevPriceData) => [...prevPriceData, dummyPrice]);
      setTimeData((prevTimeData) => [...prevTimeData, currentTime]);
      setVolumeData((prevVolumeData) => [...prevVolumeData, dummyVolume]);

      // 거래 기록 생성 및 업데이트
      const newTrade = {
        time: currentTime,
        price: dummyPrice,
        volume: dummyVolume,
        action: Math.random() > 0.5 ? 'Buy' : 'Sell', // 랜덤으로 'Buy' 또는 'Sell'
        result: Math.random() > 0.5 ? 'Win' : 'Lose', // 랜덤으로 'Win' 또는 'Lose'
      };
      setTradeHistory((prevHistory) => {
        const updatedHistory = [...prevHistory, newTrade];
        return updatedHistory.length > 15 ? updatedHistory.slice(-15) : updatedHistory; // 최신 17개만 유지
      });

      // 트렌드 업데이트
      const recentPrices = [...priceData, dummyPrice].slice(-5);
      const priceDifference = recentPrices[recentPrices.length - 1] - recentPrices[0];
      setTrend(priceDifference > 0 ? '상승세' : '하락세');
    };

    fetchDummyData();
    const interval = setInterval(fetchDummyData, 2000); // 2초마다 데이터 갱신
    return () => clearInterval(interval);
  }, [priceData, timeData, volumeData, totalProfit, previousProfit]);

  const priceChartData = {
    labels: timeData,
    datasets: [
      {
        label: 'Bitcoin Price',
        data: priceData,
        fill: false,
        borderColor: 'blue',
        tension: 0.1,
      },
    ],
  };

  const volumeChartData = {
    labels: timeData,
    datasets: [
      {
        label: 'Bitcoin Volume',
        data: volumeData,
        backgroundColor: 'green',
      },
    ],
  };

  const profitRateData = {
    labels: ['Profit', 'Loss'],
    datasets: [
      {
        label: 'Profit Rate',
        data: [profitRate, 100 - profitRate], // 수익률 및 손실 비율
        backgroundColor: ['#4caf50', '#f44336'],
        hoverOffset: 4,
      },
    ],
  };

  const accuracyData = {
    labels: ['Accuracy', 'Error'],
    datasets: [
      {
        label: 'Prediction Accuracy',
        data: [accuracy, 100 - accuracy], // 정확도 및 오류 비율
        backgroundColor: ['#2196f3', '#ff9800'],
        hoverOffset: 4,
      },
    ],
  };

  return (
    <div>
      {/* 상단 제목과 Total Profit를 나란히 배치 */}
      <div style={styles.header}>
        <h1>Bitcoin Tracker with Dummy Data</h1>
        <div style={styles.totalProfit}>
          <h2 style={styles.fixedProfit}>
            Total Profit: ${totalProfit.toLocaleString()} {/* 숫자가 움직이지 않도록 고정 */}
            <span style={{ color: isProfitIncreasing ? 'green' : 'red' }}>
              {/* 등락폭 기호 표시 */}
              {isProfitIncreasing ? ` (+${profitChange}) ↑` : ` (${profitChange}) ↓`}
            </span>
          </h2>
        </div>
      </div>

      <div style={styles.container}>
        <div style={styles.column}>
          <h2>Bitcoin Price</h2>
          <Line data={priceChartData} />

          <h2>Bitcoin Volume</h2>
          <Bar data={volumeChartData} />
        </div>

        <div style={styles.column}>
          <h2>Trade History (Dummy) - Latest 17</h2>
          <table border="1" cellPadding="10" cellSpacing="0">
            <thead>
              <tr>
                <th>Time</th>
                <th>Price (USD)</th>
                <th>Volume</th>
                <th>Action</th> {/* 샀냐 팔았냐 추가 */}
                <th>Result</th> {/* 땄냐 안땄냐 추가 */}
              </tr>
            </thead>
            <tbody>
              {tradeHistory.map((trade, index) => (
                <tr key={index}>
                  <td>{trade.time}</td>
                  <td>{trade.price}</td>
                  <td>{trade.volume}</td>
                  <td>{trade.action}</td>
                  <td>{trade.result}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>

        <div style={styles.column}>
          <h2>Current Trend: {trend}</h2>
          <p>최근 5개의 가격을 기반으로 분석된 결과: {trend}</p>

          <h2>Profit Rate</h2>
          <div style={styles.chartWrapper}>
            <Doughnut data={profitRateData} />
            <p style={styles.chartText}>{profitRate}%</p>
          </div>

          <h2>Prediction Accuracy</h2>
          <div style={styles.chartWrapper}>
            <Doughnut data={accuracyData} />
            <p style={styles.chartText}>{accuracy}%</p>
          </div>
        </div>
      </div>
    </div>
  );
}

const styles = {
